INSERT INTO `vedio` VALUES (1,'你的名字','8c88330e5f194ec5b4178e6d6bb85623.png','在远离大都会的小山村，住着巫女世家出身的高中女孩宫水三叶。不知从何时起，三叶在梦中就会变成一个住在东京的高中男孩。那里有陌生的同学和朋友，有亲切的前辈和繁华的街道，一切都是如此诱人而真实。另一方面，住在东京的高中男孩泷, 则总在梦里来到陌生的小山村，以女孩子的身份过着全新的生活。许是受那颗神秘彗星的影响，泷和三叶在梦中交换了身份。他们以他者的角度体验着对方的人生，这期间有愤怒、有欢笑也有暖心。只是两人并不知道，身份交换的背后隐藏着重大而锥心的秘密……',1,1),(2,'鬼灭之刃','44c4a5f96bd14a3e95df12113faa0254.png','',1,1),(3,'ReLefe','9de37e1f85a8442ca2abe59d1bf17c15.png','海崎新太（27岁）在作为新毕业生进入的公司工作了3个月就辞职了。之后他的就职活动也不顺利。双亲寄来的生活费也中断了，不得已只好回到乡下。能够倾听他烦恼的朋友和女友全都没有……穷途末路的海崎面前出现了一位神秘人物·夜明了。夜明向海崎提出，要他参加以尼特为对象的社会复归程序“ReLIFE”。其内容是，利用神秘的秘药，仅仅让外表回复年轻，并在一年内以高中生的身份去读高中...',1,1),(4,'孤独摇滚','669ceca9a5654555932a78f037bc5a3b.png','绰号“小孤独”的后藤独，是一个喜爱吉他的孤独少女。经常在家里独自弹奏吉他，但因为一些事情，加入了伊地知虹夏领衔的“纽带乐队”。不敢在他人面前演奏的后藤，能否成为一个出色的乐队成员呢……',1,1),(5,'魔女之旅','80354c3929bc4b4880f2c6c0aad23419.png','某个地方有个正在旅行的魔女，她的名字是伊蕾娜。身为旅人，在很长很长的旅途中，她与形形色色的国家与人们邂逅。只允许魔法师入境的国家、最喜欢肌肉的壮汉、在死亡深渊等待恋人归来的青年、独自留守国家早已灭亡的公主…最后，还有她身为魔女的至今为止与从今以后。和莫名其妙、滑稽可笑的人们相遇，接触某人美丽的日常生活，魔女日复一日编织出相逢与离别的故事。',1,1),(6,'葬送的芙莉莲','1608399623c54132b8c38e84ecf82bf2.png','山田钟人原作、阿部司作画的漫画《葬送的芙莉莲》正式宣布动画化，告知视觉图公开，2023年秋季。打倒了魔王的勇者一行人的后日谈——在“那之后”的故事。身为魔法使的芙莉莲是一位精灵，她和另外三人有着不一样的地方。对于生活在“之后”的世界、感受到的事情有着不一样的看法…',1,1),(11,'考研数学武忠祥 高等数学0基础课','d1b0173abf8e42578a816401d17c4452.png','测试',1,2),(12,'考研你还在背单词吗','6af1c9f5e1da4eb08ebe928b7c993a81.png','',1,2),(13,'线性代数基础','65687765784247eabbd7cc00048d4467.png','',1,2),(14,'概率论基础','a1af7025409242c9be09102b0b75bbe4.png','',1,2),(15,'不就是语法和长难句吗','7587cde05a47456eb8e66cf2977abe66.png','',1,2),(19,'秒速五厘米','a88384f7c5ef45ae969c5162746493cd.png','',1,1),(20,'青春猪头少年不会梦到兔女郎学姐','7af917f054a940c9a708c3905a1d5636.png','',1,1),(21,'青春猪头少年不会梦到兔女郎学姐-剧场版','b06063194fb64674a630919ed15d4061.png','',1,1),(22,'萤火之森','56aa477c334f40e3b44508d9bf64dfeb.png','',1,1),(23,'课程零散补充视频','1a62474ff33b46e19a6d112c334c6b3a.png','1. https://www.bilibili.com/video/BV1t44y1x7u5\n2. https://www.bilibili.com/video/BV1yh41127Ms',1,2),(24,'高等数学【强化】(武忠祥)','24c7a969de844e0985ef89a6421ce0c4.png','二轮强化',1,2),(25,'高等数学【提高】【考研